import Footer from './components/Footer';
import Header from './components/Header'
import MainSection from './components/MainSection';
import VideoSection from './components/VideoSection';

function App() {
  return (
    <div>
		<Header/>
		<VideoSection />
		<MainSection />
    <Footer />
    </div>
  );
}

export default App;
